import React, { useState, useEffect } from 'react';
import './prova.css';

function ClothesList() {
    const [clothes, setClothes] = useState([]);

    // Simulate receiving new clothes items from a backend service
    useEffect(() => {
        const simulateIncomingData = () => {
            const newClothes = [
                { id: 1, name: "T-Shirt", color: "Blue" },
                { id: 2, name: "Jeans", color: "Black" },
                // Add more items as needed
            ];

            newClothes.forEach((item, index) => {
                setTimeout(() => {
                    setClothes(prevClothes => [...prevClothes, item]);
                }, 3000 * (index + 1)); // Simulate delay for each new item
            });
        };

        simulateIncomingData();
    }, []);

    return (
        <div className="clothes-list">
            <h2>Clothes List</h2>
            <div>
                {clothes.map(item => (
                    <div key={item.id} className="clothes-item">
                        <strong>{item.name}</strong> - <span>{item.color}</span>
                    </div>
                ))}
            </div>
        </div>
    );
}

export default ClothesList;
